CREATE TABLE Personas(

	id int IDENTITY(1,1),
	NIF_hash BINARY(32) NOT NULL,
	nombre BINARY(32) NOT NULL,
	apellidos BINARY(32) NOT NULL,
	fecha_nacimiento BINARY(32) NOT NULL,
	provincia BINARY(32) NOT NULL,
	domicilio BINARY(32) NOT NULL
	
	CONSTRAINT PK_Personas PRIMARY KEY(id, NIF_hash)

)
GO
CREATE TABLE Cuentas_usuario(

	id int IDENTITY(1,1),
	id_persona int NOT NULL,
	NIF_hash_personas BINARY(32) NOT NULL,
	password_hash BINARY(32) NOT NULL,
	instante_creacion datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
	haVotado bit NOT NULL DEFAULT 0

	CONSTRAINT PK_Cuentas_usuario PRIMARY KEY(id),
	CONSTRAINT FK_Cuentas_usuario_Personas FOREIGN KEY (id_persona, NIF_hash_personas) REFERENCES Personas(id, NIF_HASH) ON UPDATE CASCADE ON DELETE CASCADE

)
GO

--Creación de funciones y procedimientos

-------------------------------------------
-- Este procedimiento se encarga de crear una cuenta de usuario con el hash de un DNI
-- y el hash de una contraseña.

--PRECONDICIÓN: Es necesario ejecutar el procedimiento VerificarPersona con los datos
--personales del usuario y que este devuelva 1 (verificación correcta), para así evitar cuentas de usuario fraudulentas
-------------------------------------------

GO
CREATE OR ALTER PROCEDURE CrearCuentaUsuario (
	@NIF_hash BINARY(32),
	@password_hash BINARY(32),
	@id_persona int
) AS
BEGIN

	BEGIN TRANSACTION
		VALUES (@id_persona, @NIF_hash, @password_hash)
	COMMIT		
END;

GO
-----------------------------------------------------
--Este procedimiento se encarga de verificar que los datos de identidad (nombre, apellidos...) introducidos por el usuario
--en el proceso  verificación se corresponden exactamente con los almacenados en esta base de datos.
--Además, comprueba que no exista una cuenta ya con el mismo hash del DNI.
---------------------------------------------------

GO
CREATE OR ALTER PROCEDURE VerificarPersona (
	@NIF_hash BINARY(32),
	@nombre BINARY(32),
	@apellidos BINARY(32),
	@fecha_nacimiento BINARY(32),
	@provincia BINARY(32),
	@domicilio BINARY(32),
	@exito bit = 0 OUTPUT
) AS
BEGIN

	--No existe una cuenta de usuario con el mismo DNI
	IF NOT EXISTS 
	(
		SELECT NIF_hash_personas
		FROM Cuentas_usuario
		WHERE NIF_hash_personas = @NIF_hash
     --Existe la persona cuyo DNI hace referencia
	) AND EXISTS
	(
		SELECT NIF_hash
		FROM Personas
		WHERE NIF_hash = @NIF_hash AND
		      nombre = @nombre AND
			  apellidos = @apellidos AND
			  fecha_nacimiento = @fecha_nacimiento AND
			  provincia = @provincia AND
			  domicilio = @domicilio

	)

	BEGIN
		SET @exito = 1;
	END;

	return @exito;

END;

--Creación de login y usuarios
--
--En cuanto a la autenticación, existen dos logins distintos: Uno será empleado por el servidor de autentificación para realizar
--la verificación de identidad y la creación de cuentas. El otro será el empleado por el servidor de recursos para iniciar la
--sesión de los usuarios a través de su DNI y contraseña. Estos son ServiceLogin e IdentityLogin, respectivamente.

--En lo que respecta a la autorización, se distinguen dos usuarios, API_Service y API_Identity , con niveles de 
--privilegios diferentes, en función de su rol asignado: ElectorRol, AdminRol.

--Usuario elector: Es únicamente capaz de ejecutar el procedimiento almacenado CrearCuentaUsuario
--
--Usuario administrador: Es únicamente capaz de consultar información de ambas tablas

USE master


CREATE LOGIN IdentityLogin 
	WITH PASSWORD = N'p<!c.9^M2Y`DZD4K'

CREATE LOGIN ServiceLogin
	WITH PASSWORD = N'+2uF#e9aY4rT-2RC'

USE Identidades

CREATE USER API_Identity FROM LOGIN IdentityLogin
CREATE USER API_Service FROM LOGIN ServiceLogin

CREATE ROLE IdentityRol

--Se le revocan los permisos asignados por defecto al rol.
REVOKE SELECT, INSERT, UPDATE, DELETE, REFERENCES, ALTER ON Cuentas_usuario TO IdentityRol
REVOKE SELECT, INSERT, UPDATE, DELETE, REFERENCES, ALTER ON Personas TO IdentityRol

--Se asignan los permisos adecuados al rol

GRANT SELECT ON Cuentas_usuario TO IdentityRol

-------
CREATE ROLE ServiceRol

--Se le revocan los permisos asignados por defecto al rol.
REVOKE SELECT, INSERT, UPDATE, DELETE, REFERENCES, ALTER ON Cuentas_usuario TO ServiceRol
REVOKE SELECT, INSERT, UPDATE, DELETE, REFERENCES, ALTER ON Personas TO ServiceRol

--Se asignan los permisos adecuados al rol
GRANT EXECUTE ON CrearCuentaUsuario TO ServiceRol
GRANT EXECUTE ON VerificarPersona TO ServiceRol

--Asignamos a los usuarios los permisos a través de los roles creados
ALTER ROLE ServiceRol ADD MEMBER API_Service
ALTER ROLE IdentityRol ADD MEMBER API_Identity


